mapper.select:

select 

from RMOUTE
where RMOUTE_TXDATE = #{rmouteTxdate,jdbcType=CHAR}
  and RMOUTE_BRNO = #{rmouteBrno,jdbcType=CHAR}
  and RMOUTE_ORIGINAL = #{rmouteOriginal,jdbcType=CHAR}
  and RMOUTE_FEPNO = #{rmouteFepno,jdbcType=CHAR}
  and RMOUTE_FEPSUBNO = #{rmouteFepsubno,jdbcType=CHAR}

mapper.delete:

delete from RMOUTE
where RMOUTE_TXDATE = #{rmouteTxdate,jdbcType=CHAR}
  and RMOUTE_BRNO = #{rmouteBrno,jdbcType=CHAR}
  and RMOUTE_ORIGINAL = #{rmouteOriginal,jdbcType=CHAR}
  and RMOUTE_FEPNO = #{rmouteFepno,jdbcType=CHAR}
  and RMOUTE_FEPSUBNO = #{rmouteFepsubno,jdbcType=CHAR}
